import React from 'react'

import ParallaxProvider from 'react-scroll-parallax';
import App from './App';

class AppContainer extends Component {
    render() {
        return (
            <ParallaxProvider>
                <App />
            </ParallaxProvider>
        );
    }
}

export default AppContainer;
